export const COLUMNS = [
  
    {
        Header: "ID",
        accessor: 'id'
    },
    {
        Header: "Date",
        accessor: 'date'
    },
    {
        Header: "Country",
        accessor: 'countriesAndTerritories'
    },
    {
        Header: "Cases",
        accessor: 'cases'
    },
    {
        Header: "Deaths",
        accessor: 'deaths'
    },
    {
        Header: "All Cases",
        accessor: 'allCases'
    },
    {
        Header: "All Deaths",
        accessor: 'allDeaths'
    },

 
    {
        Header: "Cases on 1000",
        accessor: 'casesOn1000'
    },
    {
        Header: "Deaths on 1000",
        accessor: 'deathsOn1000'
    }
]
